/**
 * Tests that by default Gson accepts several forms of comments.
 *
 * @author Jesse Wilson
 */
public final class CommentsTest {

    /**
     * Test for issue 212.
     */
    @Test
    public void testParseComments() {
        String json = "[\n" + "  // this is a comment\n" + "  \"a\",\n" + "  /* this is another comment */\n" + "  \"b\",\n" + "  # this is yet another comment\n" + "  \"c\"\n" + "]";
        List<String> abc = new Gson().fromJson(json, new TypeToken<List<String>>() {
        }.getType());
        assertThat(abc).containsExactly("a", "b", "c").inOrder();
    }
}

